import React, { Component } from 'react';
import songs from "./songs";

class songList extends Component {
    render() {
        return (
            <div>{
                songs.items.map((item, i) => {
                    return (
                        <div key={i}>
                            <div>
                                return()
                                item.album.name
                        </div>


                        </div>
                    )
                })}
            </div>
        );
    }
}
export default songList;
